void model_init(){
    depthwise_conv2d_13_data = init_depthwise_conv2d_13_data();
    conv2d_12_data = init_conv2d_12_data();
    depthwise_conv2d_14_data = init_depthwise_conv2d_14_data();
    conv2d_13_data = init_conv2d_13_data();
    dense_14_data = init_dense_14_data();
    dense_15_data = init_dense_15_data();

}

void model_predict(data3d_t input, data1d_t * output){
  
    prepare_buffers();
    
    //*************** LAYER 0 **************//
    // Layer name: depthwise_conv2d_13
    data3d_t output0;
    // convert image for first EmbedIA Conv2d layer
    image_adapt_layer(input, &output0);
    input = output0;
    
    depthwise_conv2d_layer(depthwise_conv2d_13_data, input, &output0);
    // Activation layer for depthwise_conv2d_13
    relu_activation(output0.data, 768);
    // Debug function for layer depthwise_conv2d_13
    print_data3d_t("depthwise_conv2d_13", output0);
    
    //*************** LAYER 1 **************//
    // Layer name: conv2d_12
    input = output0;
    // convert image for first EmbedIA Conv2d layer
    image_adapt_layer(input, &output0);
    input = output0;
    
     conv2d_layer(conv2d_12_data, input, &output0);
    // Activation layer for conv2d_12
    relu_activation(output0.data, 8192);
    // Debug function for layer conv2d_12
    print_data3d_t("conv2d_12", output0);
    
    //*************** LAYER 2 **************//
    // Layer name: max_pooling2d_12
    input = output0;
    static const pooling2d_layer_t max_pooling2d_12_data = { 2, 2 };
    max_pooling2d_layer(max_pooling2d_12_data, input, &output0);
    // Debug function for layer max_pooling2d_12
    print_data3d_t("max_pooling2d_12", output0);
    
    //*************** LAYER 3 **************//
    // Layer name: depthwise_conv2d_14
    input = output0;
    depthwise_conv2d_layer(depthwise_conv2d_14_data, input, &output0);
    // Activation layer for depthwise_conv2d_14
    relu_activation(output0.data, 2048);
    // Debug function for layer depthwise_conv2d_14
    print_data3d_t("depthwise_conv2d_14", output0);
    
    //*************** LAYER 4 **************//
    // Layer name: conv2d_13
    input = output0;
    conv2d_layer(conv2d_13_data, input, &output0);
    // Activation layer for conv2d_13
    relu_activation(output0.data, 4096);
    // Debug function for layer conv2d_13
    print_data3d_t("conv2d_13", output0);
    
    //*************** LAYER 5 **************//
    // Layer name: max_pooling2d_13
    input = output0;
    static const pooling2d_layer_t max_pooling2d_13_data = { 2, 2 };
    max_pooling2d_layer(max_pooling2d_13_data, input, &output0);
    // Debug function for layer max_pooling2d_13
    print_data3d_t("max_pooling2d_13", output0);
    
    //*************** LAYER 6 **************//
    // Layer name: flatten_7
    input = output0;
    data1d_t output1;
    flatten3d_layer(input, &output1);
    // Debug function for layer flatten_7
    print_data1d_t("flatten_7", output1);
    
    //*************** LAYER 7 **************//
    // Layer name: dense_14
    data1d_t input1;
    input1 = output1;
    dense_layer(dense_14_data, input1, &output1);
    
    // Activation layer for dense_14
    relu_activation(output1.data, 128);
    // Debug function for layer dense_14
    print_data1d_t("dense_14", output1);
    
    //*************** LAYER 8 **************//
    // Layer name: dense_15
    input1 = output1;
    dense_layer(dense_15_data, input1, &output1);
    
    // Activation layer for dense_15
    softmax_activation(output1.data, 10);
    // Debug function for layer dense_15
    print_data1d_t("dense_15", output1);
    

    *output = output1;

}

int model_predict_class(data3d_t input, data1d_t * results){
  
   
    model_predict(input, results);
    
    return argmax(*results);
    //return argmax(data1d_t);

}

